    false,nt"url": null,nt"notes": "Aerial surveys of nesting cackling Canada
    geese (Branta canadensis minima), emperor geese (Anser canagicus), greater white-fronted
    geese (Anser albifrons), and tundra swans (Cygnus columbianus) were conducted in
    the coastal zone of the Yukon Delta in 1985. The results presented are from the
    first year of a 3-4 year study to develop management surveys. Breeding pair estimates
    and 95 percent confidence intervals for each species were: cackling Canada geese
    (CCG) 5267 +/-1998, emperor geese (EG) 4954 +/-1376, greater white-fronted geese
    (WFG) 5820 +/-1258, and tundra swans 8197 +/-1238. The distribution of nesting CCG
    encompassed 1283 square miles. Relative abundance of CCG breeding pairs varied from
    less than 1 pair/square mile to greater than 10 pairs/square mile. Emperor geese
    breeding pair distribution encompassed 1859 square miles. Relative abundance of
    EG ranged from less than 1 pair/square mile to over 6 pairs/square mile. Tundra
    swans and WFG were observed over the entire survey area (5180 square miles). Relative
    abundance of breeding pairs for both ranged from less than 1 pair/square mile to
    over 3 pairs/square mile.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
